import axios from "axios";
import {link} from "./api";

export async function validUser(){
    try {
        const response = await axios.get(link+"user/check/")
        if (response.data.detail == "Invalid Token."){
            return false
        }
        else{
            return true
        }
    }catch (err) {
        return err;
    }
}
